  render() {
    return (

        <div className="Orngard">
          <h1 className="orngardHeader">
            Ørngård
          </h1>
          <div className="subheader">
            meaning "eagle farm" or "eagle home", <break />
            is a Scandinavian surname, the bearers of which <break />
            took the name of the farm or homestead they live or once lived on.
          </div>
        </div>

    );
  }
}

export default Orngard;
